import React from "react";


function Navbar() {
    return(
        <nav className="navbar navbar-light">
            <li className="nav-item">
            <a className="navbar-brand" href="/">
                Search
            </a>
            </li>
            <li className="nav-item">
            <a className="navbar-brand" href="/saved">
                Saved
            </a>
            </li>
        </nav>
    )
}

export default Navbar;
